// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awObjectValRenderFunction } from 'js/AwPropertyObjectValService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwPropertyObjectValService', () => import('js/AwPropertyObjectValService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awObjectValRenderFunction",
            "deps": "js/AwPropertyObjectValService"
        },
        "addObjectAction": {
            "actionType": "JSFunction",
            "method": "addObjectHandler",
            "inputData": {
                "prop": "{{props}}"
            },
            "deps": "js/AwPropertyObjectValService"
        },
        "removeObjectAction": {
            "actionType": "JSFunction",
            "method": "removeObjectHandler",
            "inputData": {
                "prop": "{{props}}"
            },
            "deps": "js/AwPropertyObjectValService"
        }
    },
    "data": {
        "addObject": {
            "action": "addObjectAction",
            "iconName": "cmdAdd",
            "tooltip": "{{i18n.ADD_BUTTON_TITLE}}"
        },
        "removeObject": {
            "action": "removeObjectAction",
            "iconName": "cmdDelete",
            "tooltip": "{{i18n.REMOVE_BUTTON_TITLE}}"
        },
        "isDirty": {
            "now": "false"
        }
    },
    "i18n": {
        "ADD_BUTTON_TITLE": [
            "BaseMessages"
        ],
        "REMOVE_BUTTON_TITLE": [
            "BaseMessages"
        ]
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "prop": {
            "type": "field"
        }
    },
    "_viewModelId": "AwPropertyObjectVal",
    "_uniqueViewModelId": "AwPropertyObjectVal",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awObjectValRenderFunction, undefined, ctxImportObj );

export default Component;
